You can use the useScroll hook from react-three-drei to check if the user is currently scrolling.

The useScroll hook returns scroll information like scroll position, scroll speed, scroll direction, etc. To check if the user is actively scrolling, you can check the scrollSpeed property:

```jsx
import { useScroll } from 'react-three-drei';

function Scene() {
  const { scrollSpeed } = useScroll();

  const isScrolling = scrollSpeed > 0;

  // Do something when scrolling
  if (isScrolling) {
    // ...
  }

  return <mesh />;
}
```

The scrollSpeed will be > 0 when the user is scrolling, and 0 when not scrolling. So checking if scrollSpeed is greater than 0 is an easy way to see if the scroll action is currently active.

You can also get the scroll position, direction, and other info from the useScroll hook and use it to update your 3D scene as the user scrolls.

